]


class App extends Component {
  render() { 
      return(  
         <div className="App">
        <BrowserRouter>
         <Route  path="/area1"  component={ NewRoute} />
         <Link  path="/area2"  component={ NewRoute} />
        </BrowserRouter>




       {  menus.map((menup,index)=>{
      return   <Menu title={menup.title}  poster={menup.poster} key={index} />
       })}
     </div>
    );
 }
}


export default App;
